import {Col} from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import './App.css';

function ContactInfo(){
        return (
            <Col md="auto">
                <FontAwesomeIcon icon={this.props.icon} /> {this.props.contact}
            </Col>
        )
    }

export default ContactInfo
